// PDF Maker
import { Injectable } from '@angular/core';
import * as pdfMake from 'pdfmake/build/pdfmake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import { Alignment, Style, PageSize, Margins } from 'pdfmake/interfaces';
// Modelos
import { VentaModel } from '../models/venta.model';
import { CilindroModel } from '../models/cilindro.model';

(pdfMake as any).vfs = pdfFonts.pdfMake.vfs;

@Injectable({
  providedIn: 'root'
})
export class PdfmakerService {

  greeting = 'activo-cevin';

  constructor() { }

  header(text: string): any {
    return { text, alignment: 'center', style: { fontSize: 24, bold: true } };
  }

  cilindro(cilindros: Array<CilindroModel>): any {
    const arr = [];
    arr.push([
      { text: '#', style: 'subheader' },
      { text: 'Nº Serie', style: 'subheader' },
      { text: 'Cilindro', style: 'subheader' },
      { text: 'Valor', style: 'subheader' }
    ]);
    cilindros.forEach(cilindro => {
      const activo = [];
      activo.push({ text: cilindro.correlativo, style: 'center' });
      activo.push({ text: cilindro.codigo_activo.slice(13), style: 'center' });
      activo.push({ text: cilindro.tipo_gas, style: 'center' });
      activo.push({ text: `$ ${cilindro.cobro}`, style: 'center' });
      arr.push(activo);
    });
    return arr;
  }

  imprimirPDF(codigo: string): void {
    this.greeting = codigo;
    const docDefinition = {
      pageSize: {
        width: 400,
        height: 'auto'
      } as PageSize,

      pageMargins: [ 0, 5, 0, 20 ] as Margins,

      content: [
        {
          columns: [
            [
              this.header(codigo.slice(13)),
              { qr: this.greeting, fit: 150, alignment: 'center' }
            ],
            [
              this.header(codigo.slice(13)),
              { qr: this.greeting, fit: 150, alignment: 'center' }
            ]
          ]
        }
      ]
    };

    pdfMake.createPdf(docDefinition).open();
  }

  imprimirBoucher(venta: VentaModel, cilindros: Array<CilindroModel>): void {
    const docDefinition = {
      content: [
        { text: 'Boucher de venta', style: { fontSize: 20, bold: true }, alignment: 'center' as Alignment },
        '\n',

        {
          columns: [
            {
              table: {
                widths: [260],
                body: [
                  [
                    {
                      text: `Código Venta: ${venta.codigo}`,
                      fillColor: '#f2f0f0',
                      border: [true, true, true, false],
                      style: 'normal'
                    }
                  ],
                  [
                    {
                      text: `Rut Cliente: ${venta.rut_cliente}`,
                      fillColor: '#f2f0f0',
                      border: [true, false, true, false],
                      style: 'normal'
                    }
                  ],
                  [
                    {
                      text: `Nombre Cliente: ${venta.nombre_completo}`,
                      fillColor: '#f2f0f0',
                      border: [true, false, true, false],
                      style: 'normal'
                    }
                  ],
                  [
                    {
                      text: `Fecha Venta: ${venta.fecha}`,
                      fillColor: '#f2f0f0',
                      border: [true, false, true, false],
                      style: 'normal'
                    }
                  ],
                  [
                    {
                      text: `Valor Venta: $ ${venta.monto}`,
                      fillColor: '#f2f0f0',
                      border: [true, false, true, true],
                      style: 'normal'
                    }
                  ]
                ]
              }
            },
            {
              image: 'building2',
              width: 220
            },
          ]
        },
        '\n\n\n',

        { text: 'Lista de cilindros para venta', style: 'header' },
        '\n',

        {
          table: {
            widths: [20, 120, 250, '*'],
            body: this.cilindro(cilindros)
              // [ [  ] ]
          }
        },
      ],

      styles: {
        header: {
          fontSize: 20,
          bold: true,
          alignment: 'center' as Alignment
        } as Style,
        subheader: {
          fontSize: 14,
          bold: true,
          alignment: 'center' as Alignment
        } as Style,
        center: {
          fontSize: 12,
          alignment: 'center' as Alignment
        } as Style,
        normal: {
          fontSize: 12,
          bold: true,
          alignment: 'left' as Alignment,
          margin: 3
        } as Style
      },

      images: {
        building: imagenes.imagen1,
        building2: imagenes.imagen2
      },

      PageSize: 'A4',
      PageOrientation: 'portrait',
      PageMargins: [40, 60, 40, 60],

      background: [
        {
          image: 'building',
          width: 400,
          opacity: 0.1,
          absolutePosition: { x: 100, y: 300 }
        }
      ]
    };

    pdfMake.createPdf(docDefinition).open();
  }
}

export const imagenes = {
  imagen1: 'data:image/jpeg;base64,',
  imagen2: 'data:image/jpeg;base64,'
};
